import React, {useEffect, useState} from 'react'
import {NotLogged} from "../../views/NotLogged";
import {Post} from "./Post/Post";
import {API} from "../../services/api";
import {List} from "antd";
import './layout.css'

const defaultPosts: BlogPost[] = [{
    Id: '456858568568568',
    Content: 'Hi, this is demo content. There could have been much more content.',
    Title: 'This is a demo title',
    sections: [],
    subTitle: '',
    ReadTime: 1,
    CreatedDate: new Date()
}];

export const Home = () => {

    const [posts, setPosts] = useState()

    useEffect(() => {
        API.get("/post/all")
            .then((response) => {
                const sorted = response.data.sort((a, b) => b.createdAt.$date - a.createdAt.$date)
                setPosts(sorted)
            })
            .catch(errInfo => console.error(errInfo))
    }, []);
    console.log(posts)

    if (posts === undefined || posts === [] || posts === null){
        return (
            <NotLogged/>
        )
    }
    else {
        return (
            <NotLogged>
                <List
                    dataSource={posts}
                    renderItem={post => (
                            <Post
                                title={post.title}
                                date={post.createdAt.$date}
                                body={post.body}
                            />
                            )}
                />
            </NotLogged>
        );
    }
};
